            if (employeeResponse.HasDelegateAccessOption.IsSet)
                writer.WriteBoolean("hasDelegateAccess", employeeResponse.HasDelegateAccessOption.Value!.Value);

            if (employeeResponse.LatitudeOption.IsSet)
                writer.WriteNumber("latitude", employeeResponse.LatitudeOption.Value!.Value);

            if (employeeResponse.LongitudeOption.IsSet)
                writer.WriteNumber("longitude", employeeResponse.LongitudeOption.Value!.Value);

            if (employeeResponse.LocationLastUpdatedOption.IsSet)
                writer.WriteNumber("locationLastUpdated", employeeResponse.LocationLastUpdatedOption.Value!.Value);

            if (employeeResponse.LocationCountOption.IsSet)
                writer.WriteNumber("locationCount", employeeResponse.LocationCountOption.Value!.Value);
        }
    }
}
